window.bookSummaryJSON = "<p>A one-of-a-kind audio collection of five bestselling standalone romances performed by a full cast or in duet! </p> <p>In this special collection, all five romances are full cast or duet and with performances from your favorite narrators including Vanessa Edwin, Teddy Hamilton, Jason Clarke, Andi Arndt, Shane East, Siiri Scott, Stella Hunter, Ryan West, Joe Arden and Erin Mallon. In Romance in Duet, you’ll get a fake fiancé/marriage of convenience romance in The Almost Romantic, a boss’s daughter/workplace romance in Satisfaction Guaranteed, a friends-to-lovers/spicy lessons romance in Best Laid Plans, a rivals-to-lovers romance in A Real Good Bad Thing and a swoony forbidden romantasy set in a magical Paris in The Muse. These five standalones are specially curated for your binge-listening pleasure! </p> <p>Tropes: Friends to lovers, workplace romance, forbidden romance, spicy lessons, one who got away, rivals to lovers, marriage of convenience, beach listen/travel romance, workplace romance, and fake fiancé</p>"; 
